import React, { Component } from 'react';
import * as firebase from "firebase";

class Home extends Component {

  constructor(){
    super();
    this.state = {
      speed: 10
    }
  }

  render() {
    return (
      <body>
        <h1>{this.state.speed}</h1>
      </body>
    );
  }
}

export default Home;
